import React from "react";
import {
	View,
	Text,
	StyleSheet,
	SafeAreaView,
	Image,
	TouchableOpacity,
	ImageBackground,
	ScrollView,
} from "react-native";
import { COLORS, FONTS, SIZES } from "../constants/theme";
import { images } from "../constants";
import { MainTopNavigation, MainBottomNavigation } from "../navigations";
import { Ionicons } from "@expo/vector-icons";

const Groups = ({ navigation }) => {
	return (
		<SafeAreaView style={{ width: "100%", height: "100%" }}>
			<MainTopNavigation navigation={navigation} title="GROUPS" />
			<View
				resizeMode="cover"
				style={{ width: "100%", height: "100%", position: "fixed" }}
			>
				<ScrollView
					style={{
						padding: 10,
						position: "relative",
						width: "100%",
						zIndex: 44,
						paddingTop: 70,
						paddingBottom: 70,
						overflow: "scroll",
						flexDirection: "column",
					}}
				>
					<ImageBackground
						source={images.img010}
						style={{
							height: 200,
							position: "relative",
							borderRadius: 10,
							overflow: "hidden",
							backgroundColor: COLORS.black,
							opacity: 0.9,
							borderWidth: 1,
						}}
					>
						<TouchableOpacity
							style={{
								padding: 10,
								marginTop: 130,
								left: 0,
								marginRight: 10,
								position: "absolute",
							}}
						>
							<Text style={{ color: COLORS.white, fontSize: SIZES.h3 }}>
								(Group Name)
							</Text>
							<Text style={{ color: COLORS.white }}>(Description)</Text>
						</TouchableOpacity>
					</ImageBackground>
				</ScrollView>
			</View>

			<MainBottomNavigation navigation={navigation} />
		</SafeAreaView>
	);
};

const styles = StyleSheet.create({});

export default Groups;
